import React, { Component } from 'react'
import PokemonList from '../pokemon/PokemonList'

export default class DashBoard extends Component {
  render() {
    return (
      <div className='row'>
    
            <PokemonList />
            <PokemonList />
            <PokemonList />

      </div>
    )
  }
}
